INSERT INTO `table_product` (`id`, `id_list`, `id_item`, `id_cat`, `id_sub`, `id_brand`, `photo`, `photo2`, `photo3`, `options`, `slugvi`, `slugen`, `slugzh`, `slugjp`, `slugko`, `contenten`, `contentvi`, `contentzh`, `contentjp`, `contentko`, `descen`, `descvi`, `desczh`, `descjp`, `descko`, `nameen`, `namevi`, `namezh`, `namejp`, `nameko`, `code`, `regular_price`, `discount`, `sale_price`, `numb`, `status`, `type`, `date_created`, `date_updated`, `view`, `product_list_id`) VALUES
(2, 3, 0, 0, 0, 0, 'ga-j-dabaco-5733.jpeg', '', '', '{\"p\":\"ga-j-dabaco-5733.jpeg\",\"w\":800,\"h\":687,\"m\":\"image\\/jpeg\"}', 'ga-dabaco', '', '', '', '', '', '', '', '', '', '', 'Xuất Xứ: Gà Ri Dabaco, một trong những giống gà nổi tiếng, có nguồn gốc từ Dabaco - một đơn vị uy tín trong ngành chăn nuôi.\r\n\r\nĐặc Điểm: Gà Ri Dabaco nổi bật với thịt trắng ngon, chất lượng cao và khả năng sinh sản tốt. Là lựa chọn lý tưởng cho bữa ăn gia đình đầy dinh dưỡng.', '', '', '', '', 'Gà Dabaco', '', '', '', '', 0, 0, 0, 1, 'noibat,hienthi', 'san-pham', 1704167600, 0, 11, 0),
(3, 3, 0, 0, 0, 0, 'gaf-ri-vang-rom-3125.jpeg', '', '', '{\"p\":\"gaf-ri-vang-rom-3125.jpeg\",\"w\":750,\"h\":520,\"m\":\"image\\/jpeg\"}', 'ga-ri-vang-rom', '', '', '', '', '', '', '', '', '', '', 'Ngoại Hình Quyến Rũ: Gà ri vàng rơm thu hút người chơi gia vị với bộ lông màu vàng ươm rơm đẹp mắt. Đây không chỉ là một giống gà mà còn là điểm nhấn thú vị trong chuồng nuôi.', '', '', '', '', 'Gà Ri Vàng Rơm', '', '', '', '', 0, 0, 0, 2, 'noibat,hienthi', 'san-pham', 1704167678, 0, 13, 0),
(4, 3, 0, 0, 0, 0, 'ga-lac-thuy-1945.jpeg', '', '', '{\"p\":\"ga-lac-thuy-1945.jpeg\",\"w\":500,\"h\":300,\"m\":\"image\\/jpeg\"}', 'ga-lac-thuy', '', '', '', '', '', '', '', '', '', '', 'Dành Cho Người Thích Hương Vị Độc Đáo: Gà Lạc Thủy mang đến hương vị độc đáo và thơm ngon. Thịt gà thơm ngon, chắc chắn và là lựa chọn lý tưởng cho những bữa ăn hấp dẫn.', '', '', '', '', 'Gà Lạc Thủy', '', '', '', '', 0, 0, 0, 3, 'noibat,hienthi', 'san-pham', 1704167864, 1704167886, 7, 0),
(5, 3, 0, 0, 0, 0, 'ga-don-6305.jpeg', '', '', '{\"p\":\"ga-don-6305.jpeg\",\"w\":665,\"h\":474,\"m\":\"image\\/jpeg\"}', 'ga-don', '', '', '', '', '', '', '', '', '', '', 'Sức Khỏe Tốt: Gà Đòn được biết đến với sức khỏe tốt và khả năng chống lại các bệnh lý. Thịt gà ngon miệng, thơm ngon và giàu chất dinh dưỡng.\r\n\r\nCác giống gà tại Nông Trại An Nhiên không chỉ được chọn lựa cẩn thận về ngoại hình mà còn về sức khỏe và khả năng sinh sản. Chúng tôi cam kết mang lại cho khách hàng những sản phẩm gà chất lượng, đảm bảo an toàn và đầy đủ dinh dưỡng cho bữa ăn gia đình.', '', '', '', '', 'Gà đòn', '', '', '', '', 0, 0, 0, 4, 'noibat,hienthi', 'san-pham', 1704167950, 0, 37, 0);
