INSERT INTO `table_static` (`id`, `photo`, `photo2`, `photo3`, `link_video`, `options`, `slugvi`, `slugen`, `slugzh`, `slugjp`, `slugko`, `contenten`, `contentvi`, `contentzh`, `contentjp`, `contentko`, `descen`, `descvi`, `desczh`, `descjp`, `descko`, `nameen`, `namevi`, `namezh`, `namejp`, `nameko`, `file_attach`, `type`, `status`, `date_created`, `date_updated`) VALUES
(1, 'news-2-1467-6233.jpg', NULL, NULL, NULL, '{\"p\":\"news-2-1467-6233.jpg\",\"w\":1140,\"h\":800,\"m\":\"image\\/jpeg\"}', 'trung-tam-da-lieu-sai-gon-thanh-lap-vao-nam-2024', '', NULL, NULL, NULL, '&lt;p&gt;Nike has always led the market for creativity in its designs. Flyknit shoelace technology is a prime example.&lt;br /&gt;\r\nNike is the market leader in sportswear. This is thanks to Nike possessing a series of state-of-the-art sports technologies such as Dri-fit technology in clothing production, Air Max air cushioning technology. However, when it comes to Nike shoes, we can\'t help but mention Flyknit body technology.&lt;br /&gt;\r\nIntroducing Nike Flyknit technology&lt;br /&gt;\r\nFlyknit technology when introduced in 2012 (photo: sivasdescalzo.com)&lt;br /&gt;\r\nFlyknit is the result of years of research in Nike\'s innovation kitchen. This technology was officially introduced in 2012 at the London Olympics.&lt;br /&gt;\r\nFlyknit owns impressive specs. The entire shoe body is woven from flyknit yarn weighs only 34 grams, when combined with the sole, the total weight of the Flyknit Racer shoes is only 160 grams.&lt;br /&gt;\r\nThis means that athletes will wear shoes that are only half or two-third lighter than they used to be.&lt;br /&gt;\r\nThe essence of the Flynknit technology is the most resilient, monolithic elastomeric fabrics with the latest in digital weaving technology. There are no seams or seams on a sole.&lt;br /&gt;\r\nAs a result, Flyknit is not only light, but also very hugging and can be suitable for all sports such as soccer, jogging, basketball ... etc.&lt;br /&gt;\r\nFlyknit spreading&lt;/p&gt;\r\n', '&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Với tâm huyết đặc biệt cho ngành nông nghiệp và sứ mệnh mang lại sản phẩm an toàn chất lượng, Nông Trại An Nhiên đã ra đời, tập trung vào việc cung cấp những giải pháp nông nghiệp hữu cơ tiên tiến. Chúng tôi tự hào giới thiệu các giống gà chất lượng cao, tuân thủ nguyên tắc quy trình nuôi hữu cơ khép kín theo tiêu chuẩn VAC.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://annhienfarm.vn/upload/filemanager/z4950696494762_1ba3b8c56a9e93361dae77d267c6cbb5.jpg&quot; style=&quot;width: 1280px; height: 960px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🐔&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t8e/2/16/1f414.png&quot; width=&quot;16&quot; /&gt; Đa Dạng Giống Gà Hữu Cơ&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Nông Trại An Nhiên là nơi tập trung những giống gà chất lượng, đặc biệt là Gà Ri Dabaco, Gà ri vàng rơm, Gà lạc thủy, và Gà đòn. Mỗi giống gà được chọn lựa cẩn thận để đảm bảo sức khỏe, khả năng sinh sản và chất lượng thịt tốt nhất.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🌱&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t8/2/16/1f331.png&quot; width=&quot;16&quot; /&gt; Quy Trình Nuôi Hữu Cơ Khép Kín&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Chúng tôi cam kết nuôi gà theo quy trình hữu cơ khép kín, không sử dụng hóa chất và hormone tăng trưởng. Gà được chăm sóc bằng thức ăn hữu cơ tự nhiên và có đủ không gian để di chuyển. Điều này đảm bảo rằng sản phẩm cuối cùng không chỉ ngon miệng mà còn an toàn cho sức khỏe.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://annhienfarm.vn/upload/filemanager/a2.jpg&quot; style=&quot;width: 1280px; height: 451px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🍃&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/ta9/2/16/1f343.png&quot; width=&quot;16&quot; /&gt; Tiêu Chuẩn VAC - An Toàn Cho Mọi Bữa Ăn&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Chúng tôi tuân thủ tiêu chuẩn VAC - một hệ thống kiểm soát chất lượng nghiêm ngặt, đảm bảo từng sản phẩm đều đáp ứng các yêu cầu về an toàn thực phẩm và chất lượng. Điều này giúp tạo ra những sản phẩm gà hữu cơ mà bạn có thể tin tưởng cho bữa ăn gia đình mình.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🌾&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t3c/2/16/1f33e.png&quot; width=&quot;16&quot; /&gt; Chất Lượng Từ Nông Trại Đến Bàn Ăn&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Nông Trại An Nhiên không chỉ mang lại sự đa dạng và chất lượng trong giống gà mà còn là cam kết của chúng tôi với việc cung cấp những sản phẩm nông nghiệp hữu cơ an toàn, đóng góp vào lối sống lành mạnh và bền vững.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Nông Trại An Nhiên tự hào giới thiệu bộ sưu tập đa dạng của các giống gà, mỗi giống mang đến đặc điểm riêng biệt và chất lượng cao, đồng thời đảm bảo an toàn và dinh dưỡng cho bữa ăn gia đình bạn.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://annhienfarm.vn/upload/filemanager/z4950664959978_3299f6efd25865c30feaec34be6b9c91.jpg&quot; style=&quot;width: 1280px; height: 960px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🐓&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/td/2/16/1f413.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;🌿&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tbd/2/16/1f33f.png&quot; width=&quot;16&quot; /&gt; Gà Ri Dabaco&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Xuất Xứ: Gà Ri Dabaco, một trong những giống gà nổi tiếng, có nguồn gốc từ Dabaco - một đơn vị uy tín trong ngành chăn nuôi.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Đặc Điểm: Gà Ri Dabaco nổi bật với thịt trắng ngon, chất lượng cao và khả năng sinh sản tốt. Là lựa chọn lý tưởng cho bữa ăn gia đình đầy dinh dưỡng.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🐓&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/td/2/16/1f413.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;🌿&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tbd/2/16/1f33f.png&quot; width=&quot;16&quot; /&gt; Gà Ri Vàng Rơm&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Ngoại Hình Quyến Rũ: Gà ri vàng rơm thu hút người chơi gia vị với bộ lông màu vàng ươm rơm đẹp mắt. Đây không chỉ là một giống gà mà còn là điểm nhấn thú vị trong chuồng nuôi.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🐓&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/td/2/16/1f413.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;🌿&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tbd/2/16/1f33f.png&quot; width=&quot;16&quot; /&gt; Gà Lạc Thủy&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Dành Cho Người Thích Hương Vị Độc Đáo: Gà Lạc Thủy mang đến hương vị độc đáo và thơm ngon. Thịt gà thơm ngon, chắc chắn và là lựa chọn lý tưởng cho những bữa ăn hấp dẫn.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;🐓&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/td/2/16/1f413.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;🌿&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tbd/2/16/1f33f.png&quot; width=&quot;16&quot; /&gt; Gà Đòn&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Sức Khỏe Tốt: Gà Đòn được biết đến với sức khỏe tốt và khả năng chống lại các bệnh lý. Thịt gà ngon miệng, thơm ngon và giàu chất dinh dưỡng.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Các giống gà tại Nông Trại An Nhiên không chỉ được chọn lựa cẩn thận về ngoại hình mà còn về sức khỏe và khả năng sinh sản. Chúng tôi cam kết mang lại cho khách hàng những sản phẩm gà chất lượng, đảm bảo an toàn và đầy đủ dinh dưỡng cho bữa ăn gia đình.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;https://annhienfarm.vn/upload/filemanager/z4950696510106_05678c884de19ee8cd872242d9e2dabe.jpg&quot; style=&quot;width: 1280px; height: 960px;&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Hãy đến và khám phá thế giới của những giống gà đặc sắc tại Nông Trại An Nhiên, nơi chất lượng và sự đa dạng gặp gỡ để tạo nên những bữa ăn ngon và dinh dưỡng nhất cho gia đình bạn. &lt;img alt=&quot;🌾&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t3c/2/16/1f33e.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;🍗&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t4c/2/16/1f357.png&quot; width=&quot;16&quot; /&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Liên hệ ngay với chúng tôi&lt;/span&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Hotline: 0909 89 84 73&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:16px;&quot;&gt;Văn Phòng : Số 11 Tân Trụ, P15, Q.Tân Bình , TPHCM&lt;/span&gt;&lt;/p&gt;\r\n', NULL, NULL, NULL, 'Soon after, products that used Flyknit bodies were bought by athletes and casual users alike, leading to a sales boom.\r\nThe flyknit shoes, while very expensive, sell out quickly. This reinforces Nike\'s market leadership in sports.', 'Với tâm huyết đặc biệt cho ngành nông nghiệp và sứ mệnh mang lại sản phẩm an toàn chất lượng, Nông Trại An Nhiên đã ra đời, tập trung vào việc cung cấp những giải pháp nông nghiệp hữu cơ tiên tiến. Chúng tôi tự hào giới thiệu các giống gà chất lượng cao, tuân thủ nguyên tắc quy trình nuôi hữu cơ khép kín theo tiêu chuẩn VAC.', NULL, NULL, NULL, 'About us', 'Trung tâm da liễu Sài Gòn thành lập vào năm 2024', NULL, NULL, NULL, '', 'gioi-thieu', 'hienthi', 1609288150, 1728270341),
